import { CssBaseline, Grid } from '@mui/material';
import './App.css';

function App() {
  return (
 <React.Fragment>
    <CssBaseline />
      <Grid container >
        <Grid item xs={3}>
    </Grid>
    <Grid item xs={6}>
    </Grid>
    <Grid item xs={3}>
    </Grid>
    </Grid>
    </React.Fragment>
  );
}

export default App;
